        <input type="text" onChange={(event)=> {setName(event.target.value)}}/>
        <label>Salary:</label>
        <input type="number" onChange={(event)=> {setName(event.target.value)}}/>
        <button className="infoBttn">Add Employee</button>
      </div>
    </div>
  );
}

export default App;
